import React, { useState } from 'react';
import axios from 'axios';

const TreatmentPlan: React.FC = () => {
  const [patient, setPatient] = useState({
    age: '',
    gender: '',
    medicalConditions: '',
    symptoms: '',
    currentMedications: '',
    knownAllergies: '',
    additionalInfo: '',
  });
  const [treatmentPlan, setTreatmentPlan] = useState('');
  const [isLoading, setIsLoading] = useState(false);
  const [error, setError] = useState('');

  const handleInputChange = (e: React.ChangeEvent<HTMLInputElement | HTMLTextAreaElement | HTMLSelectElement>) => {
    const { name, value } = e.target;
    setPatient(prevData => ({ ...prevData, [name]: value }));
  };

  const handleSubmit = async (e: React.FormEvent) => {
    e.preventDefault();
    if (!patient.medicalConditions) {
      setError('Please provide at least the medical conditions.');
      return;
    }

    setIsLoading(true);
    setError('');

    const patientDataString = Object.entries(patient)
      .map(([key, value]) => `${key}: ${value}`)
      .join('\n');

    const formData = new FormData();
    formData.append('patient_data', patientDataString);

    try {
      const response = await axios.post(`${process.env.REACT_APP_BACKEND_URL}/treatment_plan`, formData);
      setTreatmentPlan(response.data.treatment_plan);
    } catch (error) {
      setError('An error occurred while generating the treatment plan. Please try again.');
      console.error('Error:', error);
    } finally {
      setIsLoading(false);
    }
  };

  return (
    <div className="bg-white shadow-md rounded-lg p-6">
      <h2 className="text-2xl font-semibold mb-4">Personalized Treatment Plan Generator</h2>
      <form onSubmit={handleSubmit} className="space-y-4">
        <div>
          <label htmlFor="age" className="block text-sm font-medium text-gray-700">Patient Age</label>
          <input
            type="number"
            id="age"
            name="age"
            value={patient.age}
            onChange={handleInputChange}
            className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-blue-300 focus:ring focus:ring-blue-200 focus:ring-opacity-50"
          />
        </div>
        <div>
          <label htmlFor="gender" className="block text-sm font-medium text-gray-700">Patient Gender</label>
          <select
            id="gender"
            name="gender"
            value={patient.gender}
            onChange={handleInputChange}
            className="mt-1 block w-full pl-3 pr-10 py-2 text-base border-gray-300 focus:outline-none focus:ring-blue-500 focus:border-blue-500 sm:text-sm rounded-md"
          >
            <option value="">Select gender</option>
            <option value="Male">Male</option>
            <option value="Female">Female</option>
            <option value="Other">Other</option>
          </select>
        </div>
        <div>
          <label htmlFor="medicalConditions" className="block text-sm font-medium text-gray-700">Medical Conditions</label>
          <textarea
            id="medicalConditions"
            name="medicalConditions"
            value={patient.medicalConditions}
            onChange={handleInputChange}
            rows={3}
            className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-blue-300 focus:ring focus:ring-blue-200 focus:ring-opacity-50"
          ></textarea>
        </div>
        <div>
          <label htmlFor="symptoms" className="block text-sm font-medium text-gray-700">Symptoms</label>
          <textarea
            id="symptoms"
            name="symptoms"
            value={patient.symptoms}
            onChange={handleInputChange}
            rows={3}
            className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-blue-300 focus:ring focus:ring-blue-200 focus:ring-opacity-50"
          ></textarea>
        </div>
        <div>
          <label htmlFor="currentMedications" className="block text-sm font-medium text-gray-700">Current Medications</label>
          <textarea
            id="currentMedications"
            name="currentMedications"
            value={patient.currentMedications}
            onChange={handleInputChange}
            rows={3}
            className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-blue-300 focus:ring focus:ring-blue-200 focus:ring-opacity-50"
          ></textarea>
        </div>
        <div>
          <label htmlFor="knownAllergies" className="block text-sm font-medium text-gray-700">Known Allergies</label>
          <textarea
            id="knownAllergies"
            name="knownAllergies"
            value={patient.knownAllergies}
            onChange={handleInputChange}
            rows={3}
            className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-blue-300 focus:ring focus:ring-blue-200 focus:ring-opacity-50"
          ></textarea>
        </div>
        <div>
          <label htmlFor="additionalInfo" className="block text-sm font-medium text-gray-700">Additional Information</label>
          <textarea
            id="additionalInfo"
            name="additionalInfo"
            value={patient.additionalInfo}
            onChange={handleInputChange}
            rows={3}
            className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-blue-300 focus:ring focus:ring-blue-200 focus:ring-opacity-50"
          ></textarea>
        </div>
        <button
          type="submit"
          disabled={isLoading}
          className="w-full py-2 px-4 border border-transparent rounded-md shadow-sm text-sm font-medium text-white bg-blue-600 hover:bg-blue-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-blue-500 disabled:opacity-50"
        >
          {isLoading ? 'Generating...' : 'Generate Treatment Plan'}
        </button>
      </form>
      {error && <p className="mt-4 text-red-600">{error}</p>}
      {treatmentPlan && (
        <div className="mt-6">
          <h3 className="text-lg font-medium text-gray-900">Generated Treatment Plan:</h3>
          <pre className="mt-2 p-4 bg-gray-100 rounded-md overflow-auto text-sm">{treatmentPlan}</pre>
        </div>
      )}
    </div>
  );
};

export default TreatmentPlan;
